import React from "react";
import ProjectPreview from './ProjectPreview';

const ProjectsPage = () => {
  const projects = [
    {
      title: 'JetRockets',
      imageSrc: '/images/projects/01-thumb.jpg',
      imageAlt: 'JetRockets'
    },

    {
      title: 'Saymore',
      imageSrc: '/images/projects/01-thumb.jpg',
      imageAlt: 'Saymore'
    },

    {
      title: 'Project-03',
      imageSrc: '/images/projects/01-thumb.jpg',
      imageAlt: 'Project-03'
    },

    {
      title: 'Project-04',
      imageSrc: '/images/projects/01-thumb.jpg',
      imageAlt: 'Project-04'
    },

    {
      title: 'Saymore',
      imageSrc: '/images/projects/01-thumb.jpg',
      imageAlt: 'Saymore'
    },

    {
      title: 'Project-03',
      imageSrc: '/images/projects/01-thumb.jpg',
      imageAlt: 'Project-03'
    },

    {
      title: 'Project-04',
      imageSrc: '/images/projects/01-thumb.jpg',
      imageAlt: 'Project-04'
    }
  ];

  return (
    <div className='main__wrapper mt-16'>
      <h2 className="text-center text-[#5C62EC] mb-14">Projects</h2>
      <div className='cards'>
        {projects.map((project, index) => (
          <ProjectPreview
            key={index}
            title={project.title}
            imageSrc={project.imageSrc}
            imageAlt={project.imageAlt}
          />
        ))}
      </div>
    </div>
  );
}

export default ProjectsPage;
